define({"topics":[{"title":"Example reference entry","shortdesc":"<p class=\"shortdesc\">The following is a reference entry for one endpoint on a fictional API. This is just one way to represent all the necessary information.<\/p>","href":"topics\/reference-example-container_2.html","attributes":{"data-id":"example-reference-entry"},"menu":{"hasChildren":false},"tocID":"example-reference-entry-d249e137","topics":[]},{"title":"What's missing from your Swagger docs: How to ensure completeness when working with OpenAPI 3","shortdesc":"<p class=\"shortdesc\">It's easy to assume that the OAS3 spec endows the documentation with more accuracy or completeness, compared to documentation that is not programmatically generated. Not necessarily. Generating docs from an OAS3 spec can have <em class=\"ph i\">many<\/em> benefits, but it doesn't improve accuracy or completeness because the spec is ultimately written by humans, and information can be missing or incorrect.<\/p>","href":"topics\/swagger-reference_2.html","attributes":{"data-id":"whats-missing-from-your-swagger-docs-how-to-ensure-completeness-when-working-with-openapi-3"},"menu":{"hasChildren":false},"tocID":"whats-missing-from-your-swagger-docs-how-to-ensure-completeness-when-working-with-openapi-3-d249e148","topics":[]}]});